import { useState } from "react";
import Input from "../../components/Input";
import {
  Container,
  Button,
  ButtonContainer,
  CategoryBox,
  CategoryContainer,
  CategoryImage,
  Form,
  FormTitle,
  MapContainer,
  Section,
} from "./styles";

export default function New() {
  const [formValues, setFormValues] = useState({
    name: "",
    description: "",
    contact: "",
    category: "",
  });

  return (
    <Container>
      <Form>
        <FormTitle>Cadastro do comercio local</FormTitle>
        <Section>Dados</Section>
        <Input
          label="nome do local"
          name="name"
          value={formValues.name}
          onChange={setFormValues}
        />

        <Input
          label="Descricao"
          name="description"
          value={formValues.description}
          onChange={setFormValues}
        />

        <Input
          label="nome do local"
          name="name"
          value={formValues.name}
          onChange={setFormValues}
        />
      </Form>
    </Container>
  );
}
